params.text:
query RankingsPageTopQuery(
  $chain: [ChainScalar!]
  $count: Int!
  $cursor: String
  $sortBy: CollectionSort
  $parents: [CollectionSlug!]
  $createdAfter: DateTime
  $timeWindow: StatsTimeWindow
) {
  ...RankingsPageTop_data
}

fragment RankingsPageTop_data on Query {
  rankings(after: $cursor, chains: $chain, first: $count, sortBy: $sortBy, parents: $parents, createdAfter: $createdAfter) {
    edges {
      node {
        createdDate
        name
        slug
        logo
        isVerified
        relayId
        ...StatsV2CollectionCell_collection
        ...collection_url
        statsV2 {
          totalQuantity
        }
        windowCollectionStats(statsTimeWindow: $timeWindow) {
          floorPrice {
            unit
            eth
            symbol
          }
          numOwners
          totalSupply
          totalListed
          numOfSales
          volumeChange
          volume {
            eth
            unit
            symbol
          }
        }
        id
        __typename
      }
      cursor
    }
    pageInfo {
      endCursor
      hasNextPage
    }
  }
}

fragment StatsV2CollectionCell_collection on CollectionType {
  name
  imageUrl
  isVerified
  slug
}

fragment collection_url on CollectionType {
  slug
  isCategory
}
